import React from 'react'
import '../Css/Box.css'

const Box = () => {
    return (
        <div class="card">
            <div class="card-body">
                <p class="card-text">Com suporte a texto embaixo, que funciona como uma introdução a um conteúdo adicional.</p>
            </div>
        </div>
        )
}

export default Box
